import React from "react";

const Social = () => {
    return (
        <>
            <div className="home_social">
                <a href="https://www.instagram.com/" className="home_social-icon" target="_blank"  rel="noopener noreferrer">
                    <img width="30" height="30" src="https://img.icons8.com/ios/50/instagram-new--v1.png" alt="instagram-new--v1" />
                </a>
                <a href="https://t.me/jahongir7001" className="home_social-icon" target="_blank"  rel="noopener noreferrer">
                    <img width="30" height="30" src="https://img.icons8.com/ios/50/telegram.png" alt="telegram" />
                </a>
                <a href="https://github.com/Jahongirxon" className="home_social-icon" target="_blank"  rel="noopener noreferrer">
                    <img width="30" height="30" src="https://img.icons8.com/external-tanah-basah-basic-outline-tanah-basah/24/external-github-social-media-tanah-basah-basic-outline-tanah-basah.png" alt="external-github-social-media-tanah-basah-basic-outline-tanah-basah" />
                </a>
            </div>
        </>
    )
}
export default Social;
